import React, { Component } from "react";

export default class about extends Component {
	render() {
		return (
			<div>
				<h1>i am about page</h1>
				<p>
					Lorem ipsum dolor sit amet consectetur adipisicing elit. Molestiae,
					dicta.
				</p>
			</div>
		);
	}
}
